import React from "react"
import "../tabProgressTracker.css"

export default function TabStudentProfiles(props) {
  return (
    <div className="mainDiv">
      <div className="innerContainer2">
        <div style={{ backgroundColor: "white" }}>
          {
            <div className="completedProjects">
              <img src={props.user.profile_pic} alt="student info" />
              <h4>
                {console.log(props.user)}
                {props.user[0].first_name}
                {props.user[0].last_name}
              </h4>
            </div>
          }
        </div>
      </div>
    </div>
  )
}
